if (inactMU =='K')inactAmmount = java.lang.Math.round(java.lang.Double.parseDouble(inactAmmount)/1024);
if (cacheMU=='K')cacheAmmount = java.lang.Math.round(java.lang.Double.parseDouble(cacheAmmount)/1024);
if (bufMU =='K')bufAmmount = java.lang.Math.round(java.lang.Double.parseDouble(bufAmmount)/1024);

//Used memory = Acive + Inact + Cache + Buf + Free
scriptletResult = parseInt(activeAmmount)+parseInt(inactAmmount)+parseInt(bufAmmount)+parseInt(cacheAmmount);
}
}
catch(err){
  scriptletResult = 'NaN';
}

